{"6": ["Купил это чудо((((, прикольно раздвигается и сдвигается. Не работает зарядка, что в чехле, что без чехла ( айфон 12), пытаюсь вернуть, но с 22 апреля заявка на рассмотрении без движения. Товар бесполезный, не рекомендую к покупке", "2021-05-04T16:32:20Z", "", "0", 1, 0, 1, "Держатель для телефона автомобильный, Крепление в авто с беспроводной зарядкой", "Galaxy Shop"], "33": ["Очень плохой держатель!!! Проработал 1 месяц. Лампочка горит, а сам прибор не реагирует. Не советую.", "2021-04-12T05:58:55Z", "", "0", 1, 0, 1, "Держатель для телефона автомобильный, Крепление в авто с беспроводной зарядкой", "Galaxy Shop"], "40": ["Прицепила к решётке, держится как на клею! очень крепкий", "2021-04-07T08:21:29Z", "", "0", 1, 0, 5, "Держатель для телефона автомобильный, Крепление в авто с беспроводной зарядкой", "Galaxy Shop"], "42": ["Хорошо фиксирует, надёжно закрепляет телефон. Была ситуация с ямами глубокими, держатель как держал телефон до ям, так и остался в таком же положении, очень порадовал этот момент, теперь буду советовать всем данный держатель!", "2021-04-05T08:39:55Z", "", "0", 1, 0, 5, "Держатель для телефона автомобильный, Крепление в авто с беспроводной зарядкой", "Galaxy Shop"], "43": ["Деньги на ветер. Айфон 12 про не фиксирует. Постоянно раскрывает лепестки и айфон выпадает. Здоровья тем кто это продает.", "2021-04-05T08:28:02Z", "", "0", 2, 0, 1, "Держатель для телефона автомобильный, Крепление в авто с беспроводной зарядкой", "Galaxy Shop"], "47": ["Пытался найти хоть один плюс данного девайса, но так и не смог. Перейду к минусам. Самый большой минус, это то, что крепление в решетке радиатора не крепится от слова совсем! Пытался прикрепить то к одной решетке, то к другой, результат ужастен, телефон болтается, не фиксируется. У меня телефон с поддержкой беспроводной зарядкой Huawei p30 pro, заряжается только без чехла, в чехлах (а у меня их 3 разных моделей) не заряжает вообще. Качество материалов из которых сделан держатель, просто отвратительное